```json
{
    "id": "h",
    "Z": "e",
    "subs": [
        {
            "id": "i",
            "Y": "d",
            "subs": [
                {
                    "id": "j",
                    "X": "c",
                    "subs": []
                }
            ]
        }
    ]
}
```

To find the first object's `id` of the array named `subs`, we would start by accessing the top-level `subs` array, which is a key in the given JSON object. The first (and in this case, only) object within this `subs` array has its own `id` field. Here's how you would access it:

1. Access the top-level `subs` array: `json_object["subs"]`
2. Access the first object within this array: `json_object["subs"][0]`
3. Retrieve the `id` from this first object: `json_object["subs"][0]["id"]`

Following these steps, the first object's `id` in the `subs` array is `"i"`.
